    let buttonsColumn = Array.apply(null, Array(8)).map(
        Number.prototype.valueOf,
        0
      );

    return (
         <>
         {buttonsColumn.map(() => (
           <Buttons />
         ))}
       </>
    );
}
export default ButtonsList;
